'''Created on 19 feb 2018@author: Serena Sensini'''from builtins import objectclass SHIPWRECK(object):    #def __init__"    def __init__(self,                id_shipwreck,                 code_id,                 name_vessel,                yard,                area,                category,                confidence,                propulsion,                material,                nationality,                type,                owner,                purpose,                builder,                cause,                quality,                divers,                wreck,                composition,                inclination,                depth,                l,                w,                d,                t,                cl,                cw,                cd,                nickname,                date_built,                date_lost,                description,                history,                list                 ):            self.id_shipwreck= id_shipwreck            self.code_id= code_id             self.name_vessel = name_vessel            self.yard = yard            self.area = area            self.category = category            self.confidence = confidence            self.propulsion = propulsion            self.material = material            self.nationality = nationality            self.type = type            self.owner = owner            self.purpose = purpose            self.builder = builder            self.cause = cause            self.quality = quality            self.divers = divers            self.wreck = wreck            self.composition = composition            self.inclination = inclination            self.depth = depth            self.l = l            self.w = w            self.d = d            self.t= t            self.cl = cl            self.cw = cw            self.cd = cd            self.nickname = nickname            self.date_built = date_built            self.date_lost = date_lost            self.description = description            self.history = history            self.list  = list       def __repr__(self):        return "<SHIPWRECK('%d', '%s', '%s', '%s','%s','%s','%s','%s','%s','%s','%s','%s','%s','%s','%s', '%s', '%s', '%s','%s', '%s', '%f','%f','%f','%f','%f','%f','%f','%f','%s','%s','%s','%s', '%s', '%s')>" % (        self.id_shipwreck,         self.code_id,         self.name_vessel,        self.yard,        self.area,        self.category,        self.confidence,        self.propulsion,        self.material,        self.nationality,        self.type,        self.owner,        self.purpose,        self.builder,        self.cause,        self.quality,        self.divers,        self.wreck,        self.composition,        self.inclination,        self.depth,        self.l,        self.w,        self.d,        self.t,        self.cl,        self.cw,        self.cd,        self.nickname,        self.date_built,        self.date_lost,        self.description,        self.history,        self.list        )